import React from 'react';
import Button from '@material-ui/core/Button';
import axios from 'axios';
import history from '../../history';


function SurveyComponent(props){

    console.log(localStorage.getItem('tc'))


    return(
        <div>
            <div style={{height:'200px',width:'100%',border:'1px solid black',display:'flex',flexDirection:'column'}}>
                <div>
                    {props.name}
                </div>
                <div>
                    {props.date}
                </div>
                <div>
                    <Button variant="contained" color="primary" onClick={(event) => {history.push(window.location.href + "/" + props.name )}}>
                        Take the survey
                    </Button>
                </div>
            </div>
        </div>
    )
}

export default SurveyComponent;
